import React from "react";
import image from "../components/Images/CatDog.png";

function Home() {
  return (
    <div className="pageCard row">
      <div className="col-12 col-md-6">
        <div className="titleFont pageCardLogo">
          <h2>Pet</h2>
          <h2>Friend.ly</h2>
        </div>
        <div className="">
          <p className="bg-dark pageCardHeight">LogIn Form</p>
        </div>
      </div>
      <div className="pageCardLogo bg-dark col-12 col-md-6">
        <img src={image} alt=""></img>
      </div>
    </div>
  );
}

export default Home;
